import React, { Component } from 'react'
import './NameTitle.css';

export class NameTitle extends Component {
    render() {
        return (
            <div className="name-title-container">
                <div className="name-title-name-container">
                    <h1 className="name-title-name">Jared Cox</h1>
                </div>
            </div>
        )
    }
}

export default NameTitle
